import './App.css';
import ReactColorPicker from './components/ColorPicker';
import { useState } from 'react'
function App() {
  const [value, setValue] = useState('')
  return (
    <div className="App">
      <ReactColorPicker value={value} onChange={setValue} />
    </div>
  );
}

export default App;
